  false,\n\t\"url\": null,\n\t\"notes\": \"The 2000 field season was the third and
  final year of the Pesticide Impact Monitoring Study at Tule Lake NWR and Lower Klamath
  NWR. The objectives of this study were (1) to survey both refuges for dead or impaired
  wildlife, (2) to determine whether pesticide exposure is implicated in any death
  or impairment discovered, and (3) to investigate the source of any pesticide exposure
  detected. Survey methods, results, and discussion are included in this report.\",\n\t\"license_title\":
